import { Card, FormGroup, Typography } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      {card.map((e, i) => (
        <Card key={i} sx={{ mb: 2, width: '78%', ml: 2 }}>
          <FormGroup row>
            <img
              src={imag4}
              alt=''
              style={{
                width: '100px',
                height: '100px',
                margin: '10px',
              }}
            />
            <div>
              <Typography variant='subtitle1' sx={{ mt: 1 }}>
                {e.title}
              </Typography>
              <div style={{ display: 'flex' }}>
                {e.type === 'release' && (
                  <Typography
                    variant='body1'
                    sx={{ fontSize: 14, backgroundColor: 'blue' }}
                  >
                    {e.type}
                  </Typography>
                )}
                {e.type === 'event' && (
                  <Typography
                    variant='body1'
                    sx={{ fontSize: 14, backgroundColor: 'red' }}
                  >
                    {e.type}
                  </Typography>
                )}
                <Typography variant='body1' sx={{ fontSize: 14 }}>
                  {e.date}
                </Typography>
              </div>
            </div>
          </FormGroup>
        </Card>
      ))}
    </>
  )
}
